import React from 'react';
import { useNavigate } from 'react-router';
import '../../files.css';
import '../../App.css';

function DanteProject() {
  const navigate = useNavigate();
  const folder = require('../../images/folder.png');
  return (
    <div className='search'>
        <div className='text'>Dante</div>
        <div className='file1'>
        <img src={folder} alt="dossier"  onClick={() => navigate("/")}></img>
        <p className='text'>Dante</p>
      </div>
      <div className='file2'>
      <img src={folder} alt="dossier"></img>
        <p className='text'>Test</p>
      </div>
      <div className='file3'>
      <img src={folder} alt="dossier"></img>
        <p className='text'>Test</p>
      </div>
    </div>
  )
}

export default DanteProject;
